import React from 'react';
import Container from 'react-bootstrap/Container';


export const Layout = (props) => (
        <Container style={{width: "100%", maxWidth: "100%", backgroundColor: "#F9DAF5", paddingLeft: "100px", paddingRight:"100px", paddingBottom: "50px", marginBottom: "0"}}>
            {props.children}
        </Container>
)
